#include <fuzzer/FuzzedDataProvider.h>

#include <aconf.h>
#include "/src/xpdf-4.05/xpdf/Ref.h"
#include "/src/xpdf-4.05/xpdf/Object.h"
#include "/src/xpdf-4.05/xpdf/Stream.h"
#include "/src/xpdf-4.05/xpdf/Dict.h"
