#include "PDFDoc.h"

// Stub for OutputDev
class MyOutputDev : public OutputDev {
public:
  MyOutputDev() { }
  virtual ~MyOutputDev() { }
  virtual GBool upsideDown() override { return gFalse; }
  virtual GBool useDrawChar() override { return gTrue; }
  virtual GBool interpretType3Chars() override { return gFalse; }
  virtual void startPage(int pageNum, GfxState *state, XRef *xref) override { }
  virtual void endPage() override { }
  virtual void drawChar(GfxState *state, double x, double y,
                double dx, double dy,
                double originX, double originY,
                CharCode code, int nBytes, Unicode *u, int uLen) override { }
};

extern "C" int LLVMFuzzerTestOneInput(const uint8_t *data, size_t size) {
  FuzzedDataProvider fdp(data, size);

  int firstPage = fdp.ConsumeIntegral<int>();
  int lastPage = fdp.ConsumeIntegral<int>();
  double hDPI = fdp.ConsumeFloatingPoint<double>();
  double vDPI = fdp.ConsumeFloatingPoint<double>();
  int rotate = fdp.ConsumeIntegral<int>();
  GBool useMediaBox = fdp.ConsumeIntegral<GBool>();
  GBool crop = fdp.ConsumeIntegral<GBool>();
  GBool printing = fdp.ConsumeIntegral<GBool>();
  std::vector<char> payload = fdp.ConsumeRemainingBytes<char>();

  Object obj;
  obj.initNull();
  BaseStream *stream = new MemStream(payload.data(), 0, payload.size(), &obj);

  PDFDoc *doc = new PDFDoc(stream);
  MyOutputDev outputDev;

  doc->displayPages(&outputDev, firstPage, lastPage, hDPI, vDPI, rotate, useMediaBox, crop, printing);

  delete doc;

  return 0;
}
